[<TestClass>]
type TestCreateFourNeighboursFunction () =
    let pixel12 = Pixel((1,2),[])
    let pixel21 = Pixel((2,1),[])
    let dummyPixelMap2 coordinate =
        if      coordinate = (0, 0) then pixel00
        else if coordinate = (0, 1) then pixel01
        else if coordinate = (1, 0) then pixel10
        else if coordinate = (1, 1) then pixel11
        else if coordinate = (1, 2) then pixel12
        else if coordinate = (2, 1) then pixel21
        else raise (System.Exception("Unexpected coordinate"))
    let segmentation = Map.empty
    let neighbours = SegmentationModule.createNeighboursFunction  dummyPixelMap2 2
    [<TestMethod>] member this.TestCreateNeighboursFunction01 () = compareSets(Set [pixel01; pixel21; pixel10; pixel12], neighbours segmentation pixel11)

